/* importar el item list container, el navbar y el cartwidget */

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <div className='divNav'>
          <CartWidget />
          <Navbar />
        </div>
        {/* <Formulario /> */}
      </header>
      <Title greeting="Saludo" className="Titulo"/>
    </div>
  );
}

export default App;
